import { Row, Col } from 'react-bootstrap';
import { connect } from 'react-redux';
import { Link } from 'react-router-dom';

function WellnessList({users, session}) {
  let rows = users.map((user) => {
    let url = "/edituser/" + user.id;
    let control = (session && session.user_id == user.id) ? (<Link to={url}>Edit</Link>) : (<></>)
    return (<tr key={user.id}>
      <td>{user.name}</td>
      <td>{control}</td>
    </tr>);
  });

  function addNewWellnessButton() {
    if (session) {
      console.log(session)
      return(
        <p>
          <Link to="/users/new">
            New User
          </Link>
        </p>)
    }
  }
  return (
    <div>
      <p className="display-1">Wellness</p>
      <h1>Image Gallery Will Be Here</h1>
      <Row>
        <Col>
          <addNewWellnessButton />
        </Col>
      </Row>
    </div>
  );
}

function state2props({users, session}) {
  return { users, session};
}

export default connect(state2props)(WellnessList);
